import React from 'react'
// import { useEffect } from 'react'
// import { getAllTopicMessages } from '../utilities/forum-services'
// import { useState } from 'react'

function Topic({title, topic_id, login, timestamp, history}) {
    let timeStamp = new Date (timestamp).toLocaleString()

    return (
        <div>
            <label login={login} onClick={() => history.push(`/topic-list/${topic_id}`)}>{title} {timeStamp}</label>
        </div>
    )
}

export default Topic
